var isAnagram = function(s, t) {
    // Check if the lengths of the strings are different
    if (s.length !== t.length) {
        return false;
    }

    // Create an object to store the character counts
    const charCount = {};

    // Iterate through the first string and count the characters
    for (let i = 0; i < s.length; i++) {
        const char = s[i];
        charCount[char] = (charCount[char] || 0) + 1;
    }

    // Iterate through the second string and decrement the character counts
    for (let i = 0; i < t.length; i++) {
        const char = t[i];
        if (!charCount[char]) {
            return false;
        }
        charCount[char]--;
    }

    // Check if all character counts are zero
    return Object.values(charCount).every(count => count === 0);
};

class Solution {
    public boolean isAnagram(String s, String t) {
        // Check if the lengths of the strings are equal
        if (s.length() != t.length()) {
            return false;
        }
        // Create an array to store the frequency of each character
        int[] freq = new int[26];
        // Loop through each character in the strings
        for (int i = 0; i < s.length(); i++) {
            // Increment the frequency of the character in s
            freq[s.charAt(i) - 'a']++;
            // Decrement the frequency of the character in t
            freq[t.charAt(i) - 'a']--;
        }
        // Loop through each character in the array
        for (int i = 0; i < 26; i++) {
            // If the frequency of the character is not zero, return false
            if (freq[i] != 0) {
                return false;
            }
        }
        // If all characters have zero frequency, return true
        return true;
    }
}
